import React, { Component } from 'react';
import { Form } from 'react-bootstrap';

class DataField extends Component {
    render() {
        return (
            <Form.Group>
                <Form.Label>
                    Data:
                </Form.Label>
                <Form.Control
                    as="textarea"
                    type="text"
                    placeholder=""
                    onChange={(event) => {
                        this.props.callback(event.target.value);
                        event.preventDefault();
                    }}
                />
            </Form.Group>
        );
    };
}

export default DataField;
